      return (
        <div className="joke-body">
          <Header pageTitle={jokesTitle.toUpperCase()} />
          {/* content here */}

          <Footer jokes={plusFilled} community={comment} profile={profile} />
        </div>
      );

  }
}

export default Jokes;
